/**
 * Wpisz wygenerowany numer PESEL
 * @author Robert Urbański
 * @param args { plec: 'k' }
 */
Generator.prototype.generujPESEL = function( args ) {

    var plci = ['k','m'];
    var plec = (plci[Math.round(Math.random())]);

    if( args )
        plec = (args['plec'] || "").trim().toLowerCase();
    // console.log( 'Plec = '+plec );
    this.plec = plec;

    // Osoba musi być conajmniej pełnoletnia
    var rokUrodzenia = (new Date().getYear()+1900)-18-(Math.round(Math.random()*50));
    var mcUrodzenia = Math.round(Math.random()*11)+1;
    var dzienUrodzenia = Math.round(Math.random() * ( ( new Date( rokUrodzenia, mcUrodzenia, 0).getDate() ) - 1 ) )  + 1;
    var plecLiczbaPorzadkowa = ( plec == 'k' ? ([0, 2, 4, 6, 8])[Math.round(Math.random()*4)] : ([1, 3, 5, 7, 9])[Math.round(Math.random()*4)] );
    var liczbaPorzadkowa = ''+Math.round(Math.random()*9)+Math.round(Math.random()*9)+Math.round(Math.random()*9)+plecLiczbaPorzadkowa;
    var wagi = [1, 3, 7, 9, 1, 3, 7, 9, 1, 3];
    if(rokUrodzenia >= 2000 && rokUrodzenia <= 2099)
        mcUrodzenia = mcUrodzenia+20;

    var PESEL = (''+rokUrodzenia).substring(2)+(''+mcUrodzenia).padLeft(2)+(''+dzienUrodzenia).padLeft(2)+liczbaPorzadkowa;
    var cyfraKontrolna = (10-((PESEL[0]*wagi[0])+(PESEL[1]*wagi[1])+(PESEL[2]*wagi[2])+(PESEL[3]*wagi[3])+(PESEL[4]*wagi[4])+(PESEL[5]*wagi[5])+(PESEL[6]*wagi[6])+(PESEL[7]*wagi[7])+(PESEL[8]*wagi[8])+(PESEL[9]*wagi[9])) % 10) % 10;

    PESEL = PESEL + cyfraKontrolna;

    return {year:rokUrodzenia,month:mcUrodzenia,day:dzienUrodzenia,sex:plecLiczbaPorzadkowa,pesel:PESEL};
}


