/**
 * Wpisz wygenerowaną nazwę ulicy
 * @author Robert Urbański
 */
Generator.prototype.generujNazweFirmy = function(){

    var nazwa = '';
    var sylaby = ['na','pa','ra','ta','la','ma','bo','te','ry','ga','rzy','ty','','po','ro','nie','fe','pa','fex','nex','','lo','ko','mo','no','pi','li','so'];
    var przymiotniki = ['długie','giętkie','robocze','wygodne','mroczne','kozackie','bycze','godne','modne','szybkie','krótkie','witkie', 'wytrawne', 'rzutkie', 'miałkie', 'wypasione', 'słodkie', 'lekkie', 'wąskie', 'szerokie'];
    var rzeczowniki = ['Buty', 'Auta','Mydła','Powidła', 'Alkohole', 'Artykuły Spożywcze', 'Kurtki', 'Patyki', 'Opony', 'Słodycze', 'Artykuły budowlane', 'Korki', 'Rolnicze', 'Koki', 'Loki', 'Tłoki', 'Szafy', '', 'Nogi'];
    var rodzajPrzedsiebiorstwa = ['', 'Sp. Z o.o.', 'S.A.', 's.c.'];
    var sufixy = ['', 'XT', 'Extreme', '2D', '3D', 'Sport', 'GT', 'Hyper', 'Online', 'Net', 'Space', 'Triple', 'Ekspert', 'Cargo', 'Tour', 'Class', 'Cyber', 'Paka' ];
    var prefixy = ['', 'Super', 'Mega', 'Hiper', 'Ultra', 'Full', 'MC'];
    var laczniki = ['', '&', 'i'];
    var domena = ['.pl', '.com', '.eu', '.cz', '.sk', '.auto'];

    var typ = Math.round( Math.random()*3 )+1;

    switch(typ){
        case 1: // losowy sylabowy
            var iloscSylab = 1+Math.round( Math.random()*4 );
            for(var i=0; i < iloscSylab; i++){
                nazwa += ''+sylaby[Math.round( Math.random()*(sylaby.length-1) )];
            }

            nazwa += ' '+sufixy[Math.round( Math.random()*(sufixy.length-1) )];
            nazwa += ' '+rodzajPrzedsiebiorstwa[Math.round( Math.random()*(rodzajPrzedsiebiorstwa.length-1) )];
            break;
        case 2: // Imiona
            nazwa += Generator.prototype.generujImie()+' & '+Generator.prototype.generujImie();
            nazwa += ' '+sufixy[Math.round( Math.random()*(sufixy.length-1) )];
            nazwa += ' '+rodzajPrzedsiebiorstwa[Math.round( Math.random()*(rodzajPrzedsiebiorstwa.length-1) )];
            break;
        case 3:
            nazwa += ''+prefixy[Math.round( Math.random()*(prefixy.length-1) )];
            nazwa += ' '+przymiotniki[Math.round( Math.random()*(przymiotniki.length-1) )];
            nazwa += ' '+rzeczowniki[Math.round( Math.random()*(rzeczowniki.length-1) )];
            nazwa += ' '+rodzajPrzedsiebiorstwa[Math.round( Math.random()*(rodzajPrzedsiebiorstwa.length-1) )];
            break;
        case 4:
            nazwa += ''+prefixy[Math.round( Math.random()*(prefixy.length-1) )];

            var iloscSylab = 1+Math.round( Math.random()*4 );
            for(var i=0; i < iloscSylab; i++){
                nazwa += ''+sylaby[Math.round( Math.random()*(sylaby.length-1) )];
            }
            nazwa += ''+sufixy[Math.round( Math.random()*(sufixy.length-1) )];
            nazwa += ''+domena[Math.round( Math.random()*(domena.length-1) )];
            break;
    }
    nazwa = nazwa.trim();
    nazwa = (''+nazwa[0]).toUpperCase()+nazwa.substring(1);

    return nazwa;
}

module.exports = Generator;
